import React, { useState } from 'react';
import { receptionistAPI } from '../../api/endpoints';

const RegisterPatient = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    age: '',
    gender: '',
    address: '',
    department: ''
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await receptionistAPI.registerPatient(formData);
      // Patient registered successfully
      setFormData({ name: '', email: '', phone: '', age: '', gender: '', address: '', department: '' });
    } catch (error) {
      console.error('Registration failed');
    }
  };

  return (
    <div className="page-container">
      <div className="page-header">
        <h2>Register Patient</h2>
        <p>Add a new patient to the system</p>
      </div>

      <div className="card">
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label className="form-label">Name</label>
            <input
              className="form-input"
              type="text"
              placeholder="Enter patient name"
              value={formData.name}
              onChange={(e) => setFormData({...formData, name: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Email</label>
            <input
              className="form-input"
              type="email"
              placeholder="Enter email address"
              value={formData.email}
              onChange={(e) => setFormData({...formData, email: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Phone</label>
            <input
              className="form-input"
              type="tel"
              placeholder="Enter phone number"
              value={formData.phone}
              onChange={(e) => setFormData({...formData, phone: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Age</label>
            <input
              className="form-input"
              type="number"
              placeholder="Enter age"
              value={formData.age}
              onChange={(e) => setFormData({...formData, age: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Gender</label>
            <select
              className="form-select"
              value={formData.gender}
              onChange={(e) => setFormData({...formData, gender: e.target.value})}
              required
            >
              <option value="">Select Gender</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
            </select>
          </div>

          <div className="form-group">
            <label className="form-label">Address</label>
            <textarea
              className="form-textarea"
              placeholder="Enter address"
              value={formData.address}
              onChange={(e) => setFormData({...formData, address: e.target.value})}
              required
            />
          </div>

          <div className="form-group">
            <label className="form-label">Department</label>
            <select
              className="form-select"
              value={formData.department}
              onChange={(e) => setFormData({...formData, department: e.target.value})}
              required
            >
              <option value="">Select Department</option>
              <option value="eye">Eye</option>
              <option value="ent">ENT</option>
              <option value="skin">Skin</option>
            </select>
          </div>

          <button className="btn" type="submit">Register Patient</button>
        </form>
      </div>
    </div>
  );
};

export default RegisterPatient;
